// HomePage.js
import React from 'react';
import CategoryTitle from './CategoryTitle';

function HomePage() {
    const category_title = ["인문", "사회", "교육", "공학", "자연", "의약", "예체능", "융복합"];
    return (
        <div>
            <CategoryTitle title="Welcome to My Website!" />
            <p>Welcome to my website!</p>
            {category_title.map((title, index) => (
                <CategoryTitle key={index} title={title} />
            ))}
        </div>
    );
}

export default HomePage;
